import logo from './logo.svg';
import './App.css';
import {App as SendbirdApp} from 'sendbird-uikit'
import "sendbird-uikit/dist/index.css";
import useUserData from "./Utils/getUsers";

function App() {

    const appId = "D1E807F1-334A-426D-9CCE-38A2A82C1474"
    const userId = "5365c12b-3657-44a5-9ee9-6aa13958d5db"
    useUserData()

    console.log(process.env.REACT_APP_APPLICATION_ID)
    return (
        <div className="App">
            <SendbirdApp appId={appId} userId={userId}/>
        </div>
    );
}

export default App;
